import React from 'react';
import {ListItem,Avatar} from 'react-native-elements';
import {styles} from '../component/Styles';
import { FlatList, View } from 'react-native';
import MyHeaderDate from '../component/MyHeaderDate';

const list = [
    {
    name: 'Shirt',
    avatar_url: 'data:image/jpeg;base64,',
    subtitle: 'Cotton Shirts'
  },
  {
    name: 'Pant',
    avatar_url: 'data:image/jpeg;base64,',
    subtitle: 'Formal Pants'
  },
  {
    name: 'Watch',
    subtitle:'Formal Watches',
    avatar_url: 'data:image/jpeg;base64,'
  },
  {
    name: 'Tie',
    subtitle: 'Formal ties',
    avatar_url:'data:image/jpeg;base64,'
  },
  {
    name:'Sports Shoe',
    subtitle: 'Trendy Sports Shoes',
    avatar_url:'data:image/jpeg;base64,'
  },
  {
    name: 'Formal Shoe',
    subtitle: 'Office use Shoes',
    avatar_url: 'data:image/jpeg;base64,'
  }
]

export default class Catalogue extends React.Component{

    keyExtractor = (item, index) => index.toString()

    renderItem = ({ item }) => {
      return(
        <ListItem
        containerStyle={{width:200,height:150}}
        style={{height:151,width:201}}
        bottomDivider
        onPress={()=>{
            this.props.navigation.navigate('Catalogue1',{"details":item})
        }}
      >
        <Avatar source={{uri: item.avatar_url}} containerStyle={{width:50,height:100}} />
        <ListItem.Content style={{width:300}}>
        <ListItem.Title style={{fontWeight:'bold',fontSize:18,color:'black'}}>{item.name}</ListItem.Title>
        <ListItem.Subtitle style={{fontSize:16,color:'black'}}>{item.subtitle}</ListItem.Subtitle>
        </ListItem.Content>
        </ListItem>
  )}

    render(){
        return(
            <View style={styles.container}>
              <View style={{width:360,marginTop:90}}>
                <MyHeaderDate title="Catalogue" navigation={this.props.navigation} />
              </View>
              <View style={{marginTop:80}}>
              <FlatList
                keyExtractor={this.keyExtractor}
                data={list}
                renderItem={this.renderItem}
                style={{backgroundColor:'#F8BE85',marginTop:50,width:400}}
                scrollEnabled={false}
                numColumns={2}
              />
              </View>
            </View>
        )
    }
}